import React, { Component } from 'react'
import { Routes, Route, Link, BrowserRouter, Switch  } from "react-router-dom";

import Footer from './components/Footer'
import Header from './components/Header'
import Menu from './components/Menu'
import Content from './components/Content'
import Home from './components/Home'


export default class App extends Component {

  constructor() {
    super();
    this.state = {
      properties: [],
      filteredProperties: [],
      holdings: [],
      cart: [],
      auth: {
          investor: {}
      },
      loggedIn: false,
      time: new Date().getSeconds(),
      rent: 0,
      amount: 0
    };
  }
  render() {
    console.log("app state:", this.state);
    return (
        <Router>
            <Switch>
                <Route
                    path="/"
                    exact
                    render={props => (
                        <Home
                            {...props}
                            cart={this.state.cart}
                            loginState={this.state.auth.investor}
                            logout={this.logout}
                            rent={this.state.rent}
                        />
                    )}
                />

                <Route
                    path="/properties"
                    exact
                    render={props => (
                        <Properties
                            {...props}
                            cart={this.state.cart}
                            properties={this.state.filteredProperties}
                            holdings={this.state.holdings}
                            tempHouseImages={tempHouseImages}
                            loginState={this.state.auth.investor}
                            logout={this.logout}
                            handleFilter={this.handleFilter}
                            rent={this.state.rent}
                        />
                    )}
                />
                <Route
                    path="/properties/:id"
                    exact
                    render={props => (
                        <Property
                            {...props}
                            cart={this.state.cart}
                            property={this.state.properties}
                            sumPropertyHeld={this.sumPropertyHeld}
                            addToCart={this.addToCart}
                            loginState={this.state.auth.investor}
                            investor={this.state.auth.investor}
                            logout={this.logout}
                            tempHouseImages={tempHouseImages}
                            rent={this.state.rent}
                        />
                    )}
                />

                <Route
                    path="/ordersuccessful"
                    exact
                    render={props => (
                        <OrderSuccessful
                            {...props}
                            cart={this.state.cart}
                            loginState={this.state.auth.investor}
                            logout={this.logout}
                            rent={this.state.rent}
                        />
                    )}
                />
                <Route
                    path="/dashboard"
                    exact
                    render={props =>
                        this.state.loggedIn ? (
                            <DashBoard
                                {...props}
                                cart={this.state.cart}
                                holdings={this.state.holdings}
                                loginState={this.state.auth.investor}
                                logout={this.logout}
                                rent={this.state.rent}
                            />
                        ) : (
                            <Redirect to="/rescricted" />
                        )
                    }
                />
                <Route
                    path="/holdings"
                    exact
                    render={props =>
                        this.state.loggedIn ? (
                            <Holdings
                                {...props}
                                cart={this.state.cart}
                                holdings={this.state.holdings}
                                properties={this.state.properties}
                                loginState={this.state.auth.investor}
                                logout={this.logout}
                                rent={this.state.rent}
                            />
                        ) : (
                            <Redirect to="/rescricted" />
                        )
                    }
                />
                <Route
                    path="/cart"
                    exact
                    render={props => (
                        <Cart
                            {...props}
                            cart={this.state.cart}
                            tempHouseImages={tempHouseImages}
                            holdings={this.state.holdings}
                            loginState={this.state.auth.investor}
                            logout={this.logout}
                            clearCart={this.clearCart}
                            rent={this.state.rent}
                            addHolding={holding => this.addHolding(holding)}
                        />
                    )}
                />
                <Route
                    path="/profile"
                    exact
                    render={props =>
                        this.state.loggedIn ? (
                            <Profile
                                {...props}
                                cart={this.state.cart}
                                loginState={this.state.auth.investor}
                                logout={this.logout}
                                rent={this.state.rent}
                            />
                        ) : (
                            <Redirect to="/rescricted" />
                        )
                    }
                />
                {/* <Switch> */}
                <Route
                    exact
                    path="/login"
                    render={props => (
                        <Login {...props} handleLogin={this.login} />
                    )} 
                />
                <Route path="/signup" component={SignUp} />
                <Route path="/rescricted" component={Restricted} />
                <Route path="*" component={NotFound} />
            </Switch>
        </Router>
    );
}
}
